import { Container } from "react-bootstrap";
import Row from "react-bootstrap/Row";
import Col from "react-bootstrap/Col";
import Hero from "./Hero";

const Cont = () => {
  return (
    <Container>
      <Row className="mt-5 d">
        <Col sm={7}>
          <Hero />
        </Col>
        <Col sm={5}>
          <h2>Halo</h2>
        </Col>
      </Row>
    </Container>
  );
};

export default Cont;
